import React, {Component} from 'react';
import headerImg from '../src/images/headerImg.png';

export default class ImagesSiderBar extends Component {
    render(){
        return(
            <img src={headerImg} alt="imagesss" style={{ width: 548, height: 444 }} />
        );
    }
}
